var Adapter;

Adapter = class Adapter {
  static get(model, key) {
    if (key) {
      return model[key];
    }
    return model;
  }

  static id(model) {
    var id;
    id = this.get(model, 'id');
    if (id === void 0) {
      return id;
    }
    return `${id}`;
  }

};

module.exports = Adapter;
